data = data.split('\n')

visited = {}

def area(mp, i, q):
    cur = mp[i][q]
    visited[f"{i},{q}"] = True
    a = 1

    if i-1 >= 0 and f"{i-1},{q}" not in visited and mp[i-1][q] == cur:
        a += area(mp, i-1, q)
    if q-1 >= 0 and f"{i},{q-1}" not in visited and mp[i][q-1] == cur:
        a += area(mp, i, q-1)
    if i+1 < len(mp) and f"{i+1},{q}" not in visited and mp[i+1][q] == cur:
        a += area(mp, i+1, q)
    if q+1 < len(mp) and f"{i},{q+1}" not in visited and mp[i][q+1] == cur:
        a += area(mp, i, q+1)

    return a

def indx(mp, i, q):
    try:
        if i < 0 or q < 0:
            return None
        return mp[i][q]
    except:
        return None

